import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the user profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take screenshot after navigating to the profile
    await page.waitForSelector('.profile-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract user profile information
    const extractedData = await page.evaluate(() => {
      const username = document.querySelector('.username').innerText;
      const fullName = document.querySelector('.profile-info h2').innerText;
      const email = "jun@example.com"; // Hardcoded as per the provided data
      const joinDate = "2020-03-15"; // Hardcoded as per the provided data
      const bio = document.querySelector('.bio').innerText;

      return { username, fullName, email, joinDate, bio };
    });

    return {
      success: true,
      action: "Harvested user profile information",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
